	(1238, 'The Beatles', 'life-beatles.jpg', 'Life: Reunion Special - The Beatles From Yesterday to Today', '1995-12-11', 'Life', '169000594', 'Book, Magazine, 88 pages', NULL, 'This pictorial biography captures the spirit of those heady times and the joyful idealism of four working-class kids from Liverpool who made it: John, Paul, George and Ringo. Drawing from LIFE\'s archives and from the work of photographers who witnessed this incredible sage, this issue is packed with excitement and contains many rarely seen photographs.', 3, 'book', '2024-09-20 04:17:07', '2025-01-02 06:14:39', '0', NULL),
