	(1240, 'The Beatles', '3009746.jpg', 'The Beatles Forever', '1980', 'Bookthrift Co', '3009746', 'Book, Hardcover, 222 pages', '0811702251', 'Profiles the individual and collective careers of the rock music group that made a phenomenal impact on the popular music world in the 1960\'s.', 3, 'book', '2024-09-20 04:17:07', '2025-01-02 06:14:39', '0', NULL),
	(1241, 'The Beatles', '6604896.jpg', 'Recording The Beatles', '2006-09', 'Curvebender Publishing', '6604896', 'Book, Hardcover, 540 pages', '0978520009', 'The book\'s full title is Recording The Beatles: The Studio Equipment and Techniques Used To Record Their Classic Albums. It addresses the technical side of The Beatles\' sessions and was written with the assistance of many of the group\'s former engineers and technicians.', 3, 'book', '2024-09-20 04:17:07', '2025-01-02 06:14:39', '0', NULL),
	(1242, 'The Beatles', '2010758.jpg', 'The Beatles: Recording Sessions', '1989', 'Harmony Books', '2010758', 'Book, Hardcover, 204 pages', '0517570661', 'The Official Abbey Road Studio Session Notes 1962-1970. Chronicles the innovative techniques incorporated by the Beatles during a decade of studio recording sessions and features candid photographs of the sessions.', 3, 'book', '2024-09-20 04:17:07', '2025-01-02 06:14:39', '0', NULL),
	(1243, 'The Beatles', '55286757.jpg', 'The Beatles: Get Back', '2021-08-31', 'Callaway Arts & Entertainment', '55286757', 'Book, Hardcover, 240 pages', '0935112960', 'Get Back is the official account of the creation of their final album, Let It Be, told in The Beatles’ own words, illustrated with hundreds of previously unpublished images.', 3, 'book', '2024-09-20 04:17:07', '2025-01-02 06:14:39', '0', NULL),
	(1244, 'The Beatles', '35611.jpg', 'The Beatles: Unseen Archives', '2000-10-15', 'Parragon Books', '35611', 'Book, Paperback, 383 pages', '0760745838', 'With 600 fabulous photographs selected from the archives of the Daily Mail, The Beatles: Unseen Archives, comprehensively chronicles the heady years in which the group bestrode the world like a Colossus. The collection includes over 200 photographs from negatives never previously printed and they are published here for the first time.', 3, 'book', '2024-09-20 04:17:07', '2025-01-02 06:14:39', '0', NULL),
	(1245, 'Elvis Presley', '712619.jpg', 'The Elvis Treasures', '2002', 'Gardners Books', '712619', 'Book, Hardcover, 64 pages', '1842224808', 'This boxed set includes a CD of interviews and other recordings of Elvis\'s thoughts. Also included are facsimiles of some of his most personal documents, including his high school diploma, his contract with Sun Records, and a hand-written letter sent to his girlfriend.', NULL, 'book', '2024-09-20 04:17:07', '2025-01-02 06:14:39', '0', NULL),
	(1246, 'Elvis Presley', '4437967.jpg', 'Elvis: Commemorative Edition', '2002', 'Publications International', '4437967', 'Book, Hardcover, 320 pages', '0785348905', 'A large oversize book detailing Elvis\'s birth to death. Newspaper clippings and photos accent each page in color while you follow Elvis from a child until he died. Great book for an Elvis lover. Many hours of reading and great photos.', NULL, 'book', '2024-09-20 04:17:07', '2025-01-02 06:14:39', '0', NULL),
	(1247, 'New Order', '2359962.jpg', 'Factory Records: The Copmplete Graphic Album', '2007-09-10', 'Factory', '', 'Book, Paperback, 224 pages', '0500286361', 'Factory Records is the ultimate and only collection of Factory\'s complete graphic output, including every single piece it produced: extremely rare record sleeves, club flyers, and posters all gathered together for the first time.', NULL, 'book', '2024-09-20 04:17:07', '2025-01-02 06:14:39', '0', NULL),
