	(1407, 'The Beatles', '237526267.jpg', 'Beatles Gear: All the Fab Four\'s Instruments from Stage to Studio', '2002-10-01', 'Backbeat', '237526267', 'Book, Hardcover, 512 pages', '9781617747649', 'Even though their songs are known by millions around the world, only now has a book been published that reveals how The Beatles sounded the way they did. This lavishly illustrated hardcover volume is the first to examine all the instruments and equipment The Beatles used to compose, rehearse, perform and record some of the best-loved popular music of all time.', 3, 'book', '2025-08-26 17:49:22', '2025-08-26 17:52:12', '0', NULL),
	(1408, 'The Beatles', '676555.jpg', 'The Beatles Anthology', '2000-09-01', 'Chronicle Books', '676555', 'Book, Hardcover, 368 pages', '9780811826846', 'This extraordinary project has been made possible because Paul McCartney, George Harrison and Ringo Starr have agreed to tell their combined story especially for this book. Together with Yoko Ono Lennon, they have also made available the full transcripts (including all the outtakes) of the television and video series The Beatles Anthology. Through painstaking compilation of sources worldwide, John Lennon\'s words are equally represented in this remarkable volume.', 3, 'book', '2025-08-26 17:53:26', '2025-08-26 17:55:32', '0', NULL),
